std::string dfa2re(DFA &d) {
    auto kek = d.get_states();
    std::vector<std::string> states (kek.begin(), kek.end());
    std::map<std::string, std::map<std::string, std::string> > graph;
    decltype(graph) rgraph;

    const std::string newInitialState = "__start__";
    const std::string newFinalState = "__end__";
    const char emptyChar = '_';
    const std::string emptyCharString (1, emptyChar);

    auto addEdge = [&graph, &rgraph](const std::string& from, const std::string& by, const std::string& to){
        if (!graph[from][to].empty()) {
            graph[from][to] += '|';
            rgraph[to][from] += '|';
        }
        rgraph[to][from] += by;
        graph[from][to] += by;
        std::cout << from << ' ' << by << ' ' << to << '\n';
    };

    auto removeEdge = [&graph, &rgraph](const std::string& from, const std::string& to){
        graph[from].erase(to);
        rgraph[to].erase(from);
    };

    for (const auto& from : states) {
        for (char c : d.get_alphabet()) {
            if (d.has_trans(from, c)) {
                std::string to = d.get_trans(from, c);
                addEdge(from, std::string(1, c), to);
            }
        }
        if (d.is_final(from)) {
            addEdge(from, emptyCharString, newFinalState);
        }
        if (d.is_initial(from)) {
            addEdge(newInitialState, emptyCharString, from);
        }
    }

    const std::string OPENBR = "(";
    const std::string CLOSEBR = ")";
    const std::string OR = "|";
    const std::string CLOSURE = "*";

    for (const std::string& state : states) {
        std::cout << "state: " << state << '\n';
        const auto before = rgraph[state];
        const auto after = graph[state];

        std::cout << "before: " << '\n';
        for (auto& i : before)
            std::cout << i.first << ' ';
        std::cout << '\n';

        std::cout << "after: " << '\n';
        for (auto& i : after)
            std::cout << i.first << ' ';
        std::cout << '\n';

        std::string loop = "";
        {
        std::set<std::string> in_loop;
        for (auto& [from, re1] : before)
            for (auto& [to, re2] : after) {
                if ((from == state) && (to == state)) {
                    if (!in_loop.count(re1)) {
                        if (!loop.empty())
                            loop += OR;
                        loop += re1;
                    }
                    in_loop.insert(re1);
                    std::cout << from << ' ' << to << ' ' << re1 << '\n';
                }
            }
        }
        if (!loop.empty())
            loop = OPENBR + loop + CLOSEBR + CLOSURE;

        for (auto& [from, re1] : before)
            for (auto& [to, re2] : after) {
                {
                    std::string cur;
                    cur += OPENBR;
                        cur += OPENBR + re1 + CLOSEBR;
                        if (!loop.empty()) {
                            cur += loop;
                        }
                        cur += OPENBR + re2 + CLOSEBR;
                    cur += CLOSEBR;
                    addEdge(from, cur, to);
                }
            }

            for (auto& [from, re] : before) {
                removeEdge(from, state);
            }

            for (auto& [to, re] : after) {
                removeEdge(state, to);
            }
        

    }

    std::string ans;

    for (auto& [to, re]: graph[newInitialState])
        if (to == newFinalState) {
        ans += re;
        ans += OR;
    }

    if (!ans.empty() && !d.is_final(d.get_initial_state()))
        ans.pop_back();

    std::string fa;
    for (char c : ans)
        if (c == '_')
            fa += "()";
        else
            fa += c;



    return fa;
}

