#include <bits/stdc++.h>
using namespace std;

const int maxn = 1e5 + 5;
int a[maxn], c[maxn], n;

inline int lowbit(int x) { return x & -x; }
void build()
{
    for (int i = 1; i <= n; ++i)
    {
        c[i] += a[i];
        int j = i + lowbit(i);
        if (j <= n)
            c[j] += c[i];
    }
}
void add(int x, int k)
{
    while (x <= n)
        c[x] = c[x] + k, x = x + lowbit(x);
}
int getsum(int x)
{
    int ans = 0;
    while (x > 0)
        ans = ans + c[x], x = x - lowbit(x);
    return ans;
}

int main()
{
    ios::sync_with_stdio(false), cin.tie(0), cout.tie(0);

    cin >> n;
    for (int i = 1; i <= n; i++)
        cin >> a[i];

    build();

    for (int i = 1; i <= 2 * n; i++)
    {
        int od, x, y;
        cin >> od >> x >> y;
        if (od == 1)
            add(x, y - a[x]), a[x] = y;
        else
            cout << (getsum(y) - getsum(x - 1)) << '\n';
    }
    return 0;
}

//INPUT
int[] dimensions = Console.ReadLine()
    .Split(" ", StringSplitOptions.RemoveEmptyEntries)
    .Select(int.Parse)
    .ToArray();

int rows = dimensions[0];
int cols = dimensions[1];

//ACTION
char[,] bunnyLiar = new char[rows, cols];

//Creating The Bunny Lair
int playerRow = 0;
int playerCol = 0;  

for (int row = 0; row < rows; row++)
{
    string chars = Console.ReadLine();

    for (int col = 0; col < cols; col++)
    {
        bunnyLiar[row, col] = chars[col];

        if (bunnyLiar[row, col] == 'P')
        {
            playerRow = row;
            playerCol = col;
            bunnyLiar[row, col] = '.';
        }
    }
}

//Moving Player
bool won = true;
char[] directions = Console.ReadLine().ToCharArray();

for (int i = 0; i < directions.Length; i++)
{
    char currentMove = directions[i];

    int prevPlayerRow = playerRow;
    int prevPlayerCol = playerCol;
    
    bunnyLiar = BunnySpread(bunnyLiar, rows, cols);

    if (currentMove == 'U')
    {
        playerRow--;
    }
    else if (currentMove == 'D')
    {
        playerRow++;
    }
    else if (currentMove == 'L')
    {
        playerCol--;
    }
    else if (currentMove == 'R')
    {
        playerCol++;
    }

    //Result Check
    if (isValid(playerRow, playerCol, rows, cols))
    {
        //If Stepped On a Bunny
        if (bunnyLiar[playerRow,playerCol] == 'B')
        {
            MatrixPrint(bunnyLiar, rows, cols);
            Console.WriteLine($"dead: {playerRow} {playerCol}");
            break;
        }
    }
    else
    {
        MatrixPrint(bunnyLiar, rows, cols);
        Console.WriteLine($"won: {prevPlayerRow} {prevPlayerCol}");
        break;
    }
}

//Bunny Spread
static char[,] BunnySpread(char[,] matrix, int rows, int cols)
{
    char[,] newMatrix = new char[rows, cols];

    for (int row = 0; row < rows; row++)
    {
        for (int col = 0; col < cols; col++)
        {
            newMatrix[row, col] = matrix[row, col];
        }
    }

    for (int row = 0; row < rows; row++)
    {
        for (int col = 0; col < cols; col++)
        {
            if (matrix[row, col] == 'B')
            {
                //Up Move
                if (isValid(row-1, col, rows, cols))
                {
                    newMatrix[row-1, col] = 'B';
                }
                //Down Move
                if (isValid(row+1, col, rows, cols))
                {
                    newMatrix[row+1, col] = 'B';
                }
                //Left Move
                if (isValid(row, col-1, rows, cols))
                {
                    newMatrix[row, col-1] = 'B';
                }
                //Right Move
                if (isValid(row, col+1, rows, cols))
                {
                    newMatrix[row, col+1] = 'B';
                }
            }
        }
    }
    return newMatrix;
}

//Valid Coordinates Checker
static bool isValid(int row, int col, int rows, int cols)
{
    if (row >= 0 && row < rows && col >= 0 && col < cols)
    {
        return true;
    }
    else
    {
        return false;
    }
}

//Matrix Output
static void MatrixPrint(char[,] matrix, int rows, int cols)
{
    for (int row = 0; row < rows; row++)
    {
        for (int col = 0; col < cols; col++)
        {
            Console.Write(matrix[row, col]);
        }
        Console.WriteLine();
    }
}

package Code.Sorting;

public class Sorting {

    void bubbleSort(int[] data) {
        for (int i = 0; i < data.length; i++) {
            for (int j = 0; j < data.length; j++) {
                if (data[j] > data[j + 1]) {
                    int tmp = data[j];
                    data[j] = data[j + 1];
                    data[j + 1] = tmp;
                }
            }
        }
    }

    void selectionSort(int[] arr) {
        int n = arr.length;

        // Looping untuk iterasi dari elemen pertama hingga elemen kedua terakhir
        for (int i = 0; i < n - 1; i++) {
            int minIndex = i; // Menyimpan indeks elemen minimum

            // Looping untuk mencari elemen minimum dalam bagian belum terurut
            for (int j = i + 1; j < n; j++) {
                // Membandingkan elemen saat ini dengan elemen minimum yang ada
                if (arr[j] < arr[minIndex]) {
                    // Jika ditemukan elemen yang lebih kecil, mengupdate indeks elemen minimum
                    minIndex = j;
                }
            }

            // Swap elemen minimum dengan elemen pertama dalam bagian belum terurut
            int temp = arr[i];
            arr[i] = arr[minIndex];
            arr[minIndex] = temp;
        }
    }

    void insertionSort(int[] array) {
        int n = array.length;

        for (int i = 1; i < n; i++) {
            int currentElement = array[i];
            int j = i - 1;

            /*
             * Memindahkan elemen-elemen yang lebih besar dari currentElement ke posisi
             * setelahnya
             */
            while (j >= 0 && array[j] > currentElement) {
                array[j + 1] = array[j];
                j--;
            }

            // Menempatkan currentElement pada posisi yang tepat dalam bagian terurut
            array[j + 1] = currentElement;
        }
    }

    public static void quickSort(int[] arr, int low, int high) {
        if (low < high) {
            // Pilih pivot dan lakukan partisi array
            int pivot = partition(arr, low, high);

            // Panggil quickSort rekursif pada dua bagian array yang belum terurut
            quickSort(arr, low, pivot - 1); // Bagian kiri dari pivot
            quickSort(arr, pivot + 1, high); // Bagian kanan dari pivot
        }
    }

    private static int partition(int[] arr, int low, int high) {
        // Ambil elemen pivot (di sini, elemen terakhir)
        int pivot = arr[high];

        // Inisialisasi indeks i dengan nilai kurang dari low
        int i = low - 1;

        // Loop dari low hingga high - 1
        for (int j = low; j < high; j++) {
            // Jika elemen saat ini lebih kecil dari pivot, lakukan swap dan naikkan nilai i
            if (arr[j] < pivot) {
                i++;
                swap(arr, i, j);
            }
        }

        // Letakkan pivot pada posisi yang tepat dengan menukar elemen i + 1 dengan
        // pivot
        swap(arr, i + 1, high);

        // Kembalikan posisi pivot
        return i + 1;
    }

    private static void swap(int[] arr, int i, int j) {
        // Fungsi untuk menukar dua elemen dalam array
        int temp = arr[i];
        arr[i] = arr[j];
        arr[j] = temp;
    }

    public static void main(String[] args) {

    }
}

